import logo from './logo.svg';
import './App.css';

function App() {
  let user = {
    name: 'Grace',
    lastname: 'Alvarado',
    nick: 'MistyBlunch'
  }

  return (
    <div className="App">
      <section class="cardWrapper">
      <div class="container cardCtn">
        <a href="https://github.com/MistyBlunch" class="cardLink">
          <div class="card">
            <img
              src="https://image.flaticon.com/icons/png/512/25/25231.png"
              alt="github logo"
            />
            <h4>{ this.user.name } { this.user.lastname }</h4>
            <p>{ this.user.nick }</p>
          </div>
        </a>
      </div>
    </section>
    </div>
  );
}

export default App;
